import classes from './MarkedRecipe.module.css';

const MarkedRecipe = (props) => {
  return (
    <figure className={classes.recipe}>
      <p>{props.drinkName}</p>
      <figcaption>{props.bartender}</figcaption>
    </figure>
  );
};

export default MarkedRecipe;
